INSERT INTO `comp` (`id`, `kod_plana`, `stud_plan`, `comp_name`, `shifr_name`, `order`) VALUES
(1, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен воспринимать межкультурное разнообразие общества в социально-историческом, этическом и философском контекстах', 'УК-5', '1005'),
(2, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен выполнять интеграцию программных модулей и компонент', 'ПК-1', '3001'),
(3, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен выполнять работы по обеспечению функционирования баз данных и обеспечению их информационной безопасности', 'ПК-2', '3002'),
(4, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен выполнять работы по обслуживанию программно-аппаратными средствами сетей и инфокоммуникаций', 'ПК-5', '3005'),
(5, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен инсталлировать программное и аппаратное обеспечение для информационных и автоматизированных систем;', 'ОПК-5', '2005'),
(6, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен определять круг задач в рамках поставленной цели и выбирать оптимальные способы их решения, исходя из действующих правовых норм, имеющихся ресурсов и ограничений', 'УК-2', '1002'),
(7, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен осваивать и использовать теоретические знания и практические умения в предметной области при создании (модификации) и сопровождении информационных систем', 'ПК-3', '3003'),
(8, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен осуществлять выбор платформ и инструментальных программно-аппаратных средств для реализации информационных систем;', 'ОПК-7', '2007'),
(9, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен осуществлять деловую коммуникацию в устной и письменной формах на государственном языке Российской Федерации и иностранном(ых) языке(ах)', 'УК-4', '1004'),
(10, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен осуществлять поиск, критический анализ и синтез информации, применять системный подход для решения поставленных задач', 'УК-1', '1001'),
(11, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен осуществлять социальное взаимодействие и реализовывать свою роль в команде', 'УК-3', '1003'),
(12, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен поддерживать должный уровень физической подготовленности для обеспечения полноценной социальной и профессиональной деятельности', 'УК-7', '1007'),
(13, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен понимать принципы работы современных информационных технологий и программных средств, в том числе отечественного производства, и использовать их при решении задач профессиональной деятельности;', 'ОПК-2', '2002'),
(14, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен применять естественнонаучные и общеинженерные знания, методы математического анализа и моделирования, теоретического и экспериментального исследования в профессиональной деятельности;', 'ОПК-1', '2001'),
(15, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен применять математические модели, методы и средства проектирования информационных и автоматизированных систем.', 'ОПК-8', '2008'),
(16, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен принимать обоснованные экономические решения в различных областях жизнедеятельности', 'УК-9', '1009'),
(17, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен разрабатывать алгоритмы и программы, пригодные для практического применения в области информационных систем и технологий;', 'ОПК-6', '2006'),
(18, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен решать стандартные задачи профессиональной деятельности на основе информационной и библиографической культуры с применением информационно-коммуникационных технологий и с учетом основных требований информационной безопасности;', 'ОПК-3', '2003'),
(19, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен создавать и поддерживать в повседневной жизни и в профессиональной деятельности безопасные условия жизнедеятельности для сохранения природной среды, обеспечения устойчивого развития общества, в том числе при угрозе и возникновении чрезвычайных ситуаций и военных конфликтов', 'УК-8', '1008'),
(20, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен создавать техническую документацию на продукцию в сфере информационных технологий, управления технической информацией', 'ПК-4', '3004'),
(21, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен управлять своим временем, выстраивать и реализовывать траекторию саморазвития на основе принципов образования в течение всей жизни', 'УК-6', '1006'),
(22, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен участвовать в разработке технической документации, связанной с профессиональной деятельностью с использованием стандартов, норм и правил;', 'ОПК-4', '2004'),
(23, 3803, '090302_ИСТ_Образование_2020_о.plx', 'Способен формировать нетерпимое отношение к проявлениям экстремизма, терроризма, коррупционному поведению и противодействовать им в профессиональной деятельности', 'УК-10', '1010');
